import axios from 'axios';

export function gitProfile(username){
    console.log(username);
    return (dispatch)=>{
        return axios.get(`GET /users/:${username}`)
        .then(response => {
            dispatch({
                type:'GET_GITPROFILE',
                payload:response
            })
          })
        .catch(error => {
            throw(error);
            });
    }
}
